import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import { Route, Routes, Navigate } from "react-router-dom";
import "./App.css";
import FixedNav from "./folders/fixed nav/fixed nav.jsx";
import SideNav from "./folders/side nav/side nav.jsx";

function App() {
  return (
    <React.Fragment>
      <div className="parent-flex">
        <Router>
          <FixedNav />
          <SideNav />

        </Router>
      </div>
    </React.Fragment>
  );
}

export default App;
